import { Formik,Form,Field } from "formik";
import React from "react";
import ReactDOM from "react";

const UserLoginPage = (props) => {
    console.log(props.activeUserCheck);

    return ( 
        <div>
            <Formik
            initialValues={{
                userName:'',
                password:'',
            }}
            onSubmit= {(event) => props.activeUserCheck({userName:event.userName.value,password:event.password.value})}
            // on submit function goes here
            >
                <Form>
                 <label htmlFor="userName">User Name</label>
                 <Field id='userNameField' name='userName' placeholder='Enter User Name' />

                 <label htmlFor="password">Password</label>
                 <Field id='passwordField' name='password' placeholder='Enter Password' />

                <button type='submit'>Sign In</button>
                </Form>
            </Formik>
        </div>
    )
} 

export default UserLoginPage
